- input: "TEXT\x1CC00001305\x1C.TEXT\x1C\x1CF3XA\x1CResponse to FEC Letter of April
    22, 2013 requesting additional information for the Year End Report (11/27/2012
    - 12/31/2012)                                                                Item
    1 - The sum total memo Schedule A listings associated with transfers totaling
    $427,500.35 from the referenced joint fundraising committee is $471,750, and is
    broken down as follows: June Monthly Report-$37,700; August Monthly Report-$59,500;
    October Monthly Report-$61,000; 12 Day Pre-General Report-$177,150; 30 Day Post-General
    Report-$74,650; and Year-End Report-$61,750.  This memo sum is greater than the
    amount of transfer, with the difference being the expense associated with the
    fund.                                                                                               Item
    2 - With regard to Schedule A Line 15 offset of $7237.26 from U.S. Postal Service,
    this was a refund from an Advance Deposit Postage Account for a mailer sent out
    by vendor Redwave Communications, and reported in the 30 Day Post-General Report.
    \ Final postage amount decreased from estimated postage amount due to smaller
    mailing list.\n"
